/* [ Stock - foreign ] */

CREATE TABLE trade_history_stock_foreign (
    transaction_date  DATE NOT NULL,  /* 거래일자 */
    stock_code  VARCHAR(30), /* 종목코드 */
    exchange  VARCHAR(30),   /* 거래소 */
    transaction_type  VARCHAR(50),  /* 거래종류 */
    description  VARCHAR(120), /* 적요명 */
    stock_name  VARCHAR(100),  /* 종목명 */
    currency  VARCHAR(30),     /* 통화 */
    transaction_quantity  DECIMAL(13, 4),      /* 거래수량 */
    unit_price_exchange_rate  DECIMAL(13, 4),  /* 거래단가/환율 */ 
    transaction_amount  DECIMAL(13, 4),  /* 거래금액 */
    deposit_balance  DECIMAL(13, 4),     /* 예수금잔고 */
    transaction_amount_foreign  DECIMAL(13, 4),  /* 거래금액(외) */
    settlement_amount  DECIMAL(13, 4),           /* 정산금액 */
    settlement_amount_foreign  DECIMAL(13, 4),   /* 정산금액(외) */
    foreign_currency_deposit_balance  DECIMAL(13, 4),  /* 외화예수금잔고 */
    total_taxes  DECIMAL(13, 4),   /* 세금합 */
    fees_foreign  DECIMAL(13, 4),  /* 수수료(외) */
    stamp_tax  DECIMAL(13, 4),     /* 인지세 */
    securities_balance  DECIMAL(13, 4),   /* 유가금잔 */
    outstanding_balance_krw_stock  DECIMAL(13, 4),  /* 미수(원/주) */
    outstanding_balance_foreign  DECIMAL(13, 4),    /* 미수(외) */
    total_delinquency  DECIMAL(13, 4),  /* 연체합 */
    total_repayment  DECIMAL(13, 4),    /* 변제합 */
    total_repayment_foreign  DECIMAL(13, 4),   /* 변제합(외) */
    media_type  VARCHAR(50),           /* 매체구분 */
    processing_time  TIME NOT NULL,    /* 처리시간 */
    foreign_paid_tax_amount  DECIMAL(13, 4)   /* 외국납부세액 */
);


/* 해외주식 배당 */
SELECT 
	FORMAT( SUM(dividend_calculation.net_dividend_income), 4 ) as '세후 배당 수익(단위 : 원)'
FROM
    (
        select 
            yield_subtbl.currency, 
            case
                when yield_subtbl.currency = 'USD' then 1200 * ( yield_subtbl.yield - coalesce(expense_subtbl.expense, 0) )
                when yield_subtbl.currency = 'SGD' then 900 * ( yield_subtbl.yield - coalesce(expense_subtbl.expense, 0) )
                when yield_subtbl.currency = 'HKD' then 180 * ( yield_subtbl.yield - coalesce(expense_subtbl.expense, 0) )
                else yield_subtbl.yield - coalesce(expense_subtbl.expense, 0)
            end as net_dividend_income
        from 
            (
                select  currency, SUM(settlement_amount)+SUM(settlement_amount_foreign) as yield
                from    trade_history_stock_foreign 
                where   description in ('배당금(외화)입금', '세금환급(배당)입금') 
                group by  currency
            ) as yield_subtbl
            
            left outer join
            
            (
                select  currency, sum(settlement_amount)+sum(settlement_amount_foreign) as expense
                from    trade_history_stock_foreign 
                where   description in ('해외배당세출금', '배당입금취소출금(외화)', '세액추징(배당)출금') 
                group by  currency
            ) as expense_subtbl
            
            on yield_subtbl.currency = expense_subtbl.currency
    ) dividend_calculation;


